<div id="page-wrapper" class="{{$state.current.data.specialClass}} {{$state.current.name}}">
    <!--&lt;!&ndash; Page wrapper &ndash;&gt;-->
    <div ui-view="navbar" ng-cloak=""></div>
    <!-- Main view  -->

        <div class="row wrapper border-bottom white-bg page-heading">
            <div class="col-md-6 text-left">
                <div class="col-md-2 text-center hidden-xs hidden-sm">
                    <img alt="image"
                         style="max-width: 62px"
                         class="m-t-md img-rounded"
                         src="content/images/logo-wp-62.png"/>
                </div>
                <div class="col-md-10">
                    <h2 translate="{{!$state.current.data.pageTitle?$state.current.name:$state.current.data.pageTitle}}"></h2>
                    <div ncy-breadcrumb></div>
                </div>
            </div>

            <div class="col-md-6 text-left hidden-xs hidden-sm">
                <div class="col-md-10 text-right">
                    <h2>
                       Prefeitura Municipal de Rio Branco
                    </h2>
                    <p> Tiroliro </p>
                </div>
                <div class="col-md-2 text-center">
                    <img alt="image"
                         style="max-width: 62px"
                         class="m-t-md img-rounded"
                         src="content/images/logo-rb.png"/>
                </div>
            </div>
        </div>
        <div class="wrapper wrapper-content animated fadeInRight" ui-view="content">

        </div>
    </div>
    <!-- Footer -->
    <div ui-view="footer"></div>
</div>
